import React from 'react';
import TagList from '../../components/Friends/TagList';

const TagContainer = () => {
  const tags = ['축구', '야구', '영화', '낮잠'];
  const onSubmit = (e) => {
    e.preventDefault();
  };
  return <TagList onSubmit={onSubmit} tags={tags} />;
};

export default TagContainer;
